import React from 'react'

export class APIInformation extends React.Component {

  constructor() {
     super();
   }

  render() {
    return (
      <div>
      <div className="row">
      <div className="col-md-6 offset-1">
          <h1>Welcome to the Amy Winehouse API Portal!</h1>
          <p>This API is able to make public API calls to retrieve certain information about this artist. Sign Up for an API
          key and start making requests!
          </p>
      </div>
      </div>
      </div>
  )
}

}
export default APIInformation;
